(6, 'Customer Service', 'customerservices', '<h3>Customer Service</h3>\r\n<ul>\r\n<li class="current"><strong><a title="Contact Us" href="{{store url=contacts}} ">Contact Us</a></strong></li>\r\n<li class="current"><strong><a title="FAQs" href="{{store url=faq}} ">FAQs</a></strong></li>\r\n<li class="current"><strong><a title="Shipping" href="{{store url=delivery-policy}} ">Shipping</a></strong></li>\r\n<li class="current"><strong><a title="Check Order Status" href="{{store url=orderstatus}} ">Check Order Status</a></strong></li>\r\n</ul>', '2013-12-12 10:14:32', '2013-12-16 01:19:04', 1),
