(1, '404 Not Found 1', 'unilab_two_columns_left', 'Page keywords', 'Page description', 'no-route', NULL, '<div class="page-title">\r\n<h1>Whoops, our bad...</h1>\r\n</div>\r\n<dl><dt>The page you requested was not found, and we have a fine guess why.</dt><dd>\r\n<ul class="disc">\r\n<li>If you typed the URL directly, please make sure the spelling is correct.</li>\r\n<li>If you clicked on a link to get here, the link is outdated.</li>\r\n</ul>\r\n</dd></dl><dl><dt>What can you do?</dt><dd>Have no fear, help is near! There are many ways you can get back on track with Magento Store.</dd><dd>\r\n<ul class="disc">\r\n<li><a onclick="history.go(-1); return false;" href="#">Go back</a> to the previous page.</li>\r\n<li>Use the search bar at the top of the page to search for your products.</li>\r\n<li>Follow these links to get you back on track!<br /><a href="{{store url=""}}">Store Home</a> <span class="separator">|</span> <a href="{{store url="customer/account"}}">My Account</a></li>\r\n</ul>\r\n</dd></dl>', '2013-10-17 02:38:51', '2013-12-12 08:45:11', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(2, 'Home page', 'unilab_two_columns_left', NULL, NULL, 'home', NULL, '<div class="page-title">\r\n<h2>Home Page</h2>\r\n</div>', '2013-10-17 02:38:52', '2013-10-17 07:16:16', 1, 0, '<!--<reference name="content">\r\n        <block type="catalog/product_new" name="home.catalog.product.new" alias="product_new" template="catalog/product/new.phtml" after="cms_page">\r\n            <action method="addPriceBlockType">\r\n                <type>bundle</type>\r\n                <block>bundle/catalog_product_price</block>\r\n                <template>bundle/catalog/product/price.phtml</template>\r\n            </action>\r\n        </block>\r\n        <block type="reports/product_viewed" name="home.reports.product.viewed" alias="product_viewed" template="reports/home_product_viewed.phtml" after="product_new">\r\n            <action method="addPriceBlockType">\r\n                <type>bundle</type>\r\n                <block>bundle/catalog_product_price</block>\r\n                <template>bundle/catalog/product/price.phtml</template>\r\n            </action>\r\n        </block>\r\n        <block type="reports/product_compared" name="home.reports.product.compared" template="reports/home_product_compared.phtml" after="product_viewed">\r\n            <action method="addPriceBlockType">\r\n                <type>bundle</type>\r\n                <block>bundle/catalog_product_price</block>\r\n                <template>bundle/catalog/product/price.phtml</template>\r\n            </action>\r\n        </block>\r\n    </reference>\r\n    <reference name="right">\r\n        <action method="unsetChild"><alias>right.reports.product.viewed</alias></action>\r\n        <action method="unsetChild"><alias>right.reports.product.compared</alias></action>\r\n    </reference>-->', NULL, NULL, NULL, NULL, NULL),
(3, 'About Us', 'unilab_two_columns_left', NULL, NULL, 'aboutus', 'About Us', '<p>Health Delivery System, Inc. (HDSI) is a Healthcare Manager initially established by the Unilab Group to arrange and handle the health services required by its employees and their dependents.</p>\r\n<p>In 2006, it expanded its reach and has since become the trusted Health Plan Manager of other corporations, including:</p>\r\n<ul style="list-style: circle; padding-left: 40px;">\r\n<li>Southeast Asia Food Inc.</li>\r\n<li>Nutri-Asia, Inc (formerly Universal Food Corp.)</li>\r\n<li>Healthway Medical Clinic and its MediAccess accounts</li>\r\n<li>Del Monte Phils, Inc.</li>\r\n<li>Papertech, Inc.</li>\r\n<li>Verde Foods, Inc.</li>\r\n<li>Manson Drug / Argent Business (MedExpress)</li>\r\n<li>FPD Asia Property Services, Inc.</li>\r\n</ul>\r\n<p>HDSI today is committed to deliver comprehensive health care coverage that includes the following:</p>\r\n<ul style="list-style: circle; padding-left: 40px;">\r\n<li>Hospital Confinement or In-patient Care Services</li>\r\n<li>Out-patient Services</li>\r\n<li>Preventive Health Care Services</li>\r\n<li>Dental Services</li>\r\n</ul>\r\n<p>HDSI performs the health care management activities and serves as a benefit manager to its client companies. It sets a standard in accrediting its partner health providers (i.e., hospitals, clinics and doctors). It develops appropriate benefits matrix according to the budget specifications of a client.</p>\r\n<p>HDSI management has a wealth of experience in health research and studies. They have played active roles in the development and promotion of health products and other allied commodities in the country. Complement the foregoing, HDSI has its own Clinic (&ldquo;Health First&rdquo;) located at Unit 305 Level 3, EDSA Central Pavilion, EDSA corner Shaw Blvd, Mandaluyong City. The clinic renders the following services: medical, dental, pediatrics, ob/gyne, minor surgery; it also has its own laboratory, pharmacy, and x-ray facilities.</p>', '2013-10-17 02:38:52', '2013-12-12 08:57:17', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
