(5, 'Enable Cookies', 'one_column', NULL, NULL, 'enable-cookies', NULL, '<div class="std">\r\n    <ul class="messages">\r\n        <li class="notice-msg">\r\n            <ul>\r\n                <li>Please enable cookies in your web browser to continue.</li>\r\n            </ul>\r\n        </li>\r\n    </ul>\r\n    <div class="page-title">\r\n        <h1><a name="top"></a>What are Cookies?</h1>\r\n    </div>\r\n    <p>Cookies are short pieces of data that are sent to your computer when you visit a website. On later visits, this data is then returned to that website. Cookies allow us to recognize you automatically whenever you visit our site so that we can personalize your experience and provide you with better service. We also use cookies (and similar browser data, such as Flash cookies) for fraud prevention and other purposes. If your web browser is set to refuse cookies from our website, you will not be able to complete a purchase or take advantage of certain features of our website, such as storing items in your Shopping Cart or receiving personalized recommendations. As a result, we strongly encourage you to configure your web browser to accept cookies from our website.</p>\r\n    <h2 class="subtitle">Enabling Cookies</h2>\r\n    <ul class="disc">\r\n        <li><a href="#ie7">Internet Explorer 7.x</a></li>\r\n        <li><a href="#ie6">Internet Explorer 6.x</a></li>\r\n        <li><a href="#firefox">Mozilla/Firefox</a></li>\r\n        <li><a href="#opera">Opera 7.x</a></li>\r\n    </ul>\r\n    <h3><a name="ie7"></a>Internet Explorer 7.x</h3>\r\n    <ol>\r\n        <li>\r\n            <p>Start Internet Explorer</p>\r\n        </li>\r\n        <li>\r\n            <p>Under the <strong>Tools</strong> menu, click <strong>Internet Options</strong></p>\r\n            <p><img src="{{skin url="images/cookies/ie7-1.gif"}}" alt="" /></p>\r\n        </li>\r\n        <li>\r\n            <p>Click the <strong>Privacy</strong> tab</p>\r\n            <p><img src="{{skin url="images/cookies/ie7-2.gif"}}" alt="" /></p>\r\n        </li>\r\n        <li>\r\n            <p>Click the <strong>Advanced</strong> button</p>\r\n            <p><img src="{{skin url="images/cookies/ie7-3.gif"}}" alt="" /></p>\r\n        </li>\r\n        <li>\r\n            <p>Put a check mark in the box for <strong>Override Automatic Cookie Handling</strong>, put another check mark in the <strong>Always accept session cookies </strong>box</p>\r\n            <p><img src="{{skin url="images/cookies/ie7-4.gif"}}" alt="" /></p>\r\n        </li>\r\n        <li>\r\n            <p>Click <strong>OK</strong></p>\r\n            <p><img src="{{skin url="images/cookies/ie7-5.gif"}}" alt="" /></p>\r\n        </li>\r\n        <li>\r\n            <p>Click <strong>OK</strong></p>\r\n            <p><img src="{{skin url="images/cookies/ie7-6.gif"}}" alt="" /></p>\r\n        </li>\r\n        <li>\r\n            <p>Restart Internet Explore</p>\r\n        </li>\r\n    </ol>\r\n    <p class="a-top"><a href="#top">Back to Top</a></p>\r\n    <h3><a name="ie6"></a>Internet Explorer 6.x</h3>\r\n    <ol>\r\n        <li>\r\n            <p>Select <strong>Internet Options</strong> from the Tools menu</p>\r\n            <p><img src="{{skin url="images/cookies/ie6-1.gif"}}" alt="" /></p>\r\n        </li>\r\n        <li>\r\n            <p>Click on the <strong>Privacy</strong> tab</p>\r\n        </li>\r\n        <li>\r\n            <p>Click the <strong>Default</strong> button (or manually slide the bar down to <strong>Medium</strong>) under <strong>Settings</strong>. Click <strong>OK</strong></p>\r\n            <p><img src="{{skin url="images/cookies/ie6-2.gif"}}" alt="" /></p>\r\n        </li>\r\n    </ol>\r\n    <p class="a-top"><a href="#top">Back to Top</a></p>\r\n    <h3><a name="firefox"></a>Mozilla/Firefox</h3>\r\n    <ol>\r\n        <li>\r\n            <p>Click on the <strong>Tools</strong>-menu in Mozilla</p>\r\n        </li>\r\n        <li>\r\n            <p>Click on the <strong>Options...</strong> item in the menu - a new window open</p>\r\n        </li>\r\n        <li>\r\n            <p>Click on the <strong>Privacy</strong> selection in the left part of the window. (See image below)</p>\r\n            <p><img src="{{skin url="images/cookies/firefox.png"}}" alt="" /></p>\r\n        </li>\r\n        <li>\r\n            <p>Expand the <strong>Cookies</strong> section</p>\r\n        </li>\r\n        <li>\r\n            <p>Check the <strong>Enable cookies</strong> and <strong>Accept cookies normally</strong> checkboxes</p>\r\n        </li>\r\n        <li>\r\n            <p>Save changes by clicking <strong>Ok</strong>.</p>\r\n        </li>\r\n    </ol>\r\n    <p class="a-top"><a href="#top">Back to Top</a></p>\r\n    <h3><a name="opera"></a>Opera 7.x</h3>\r\n    <ol>\r\n        <li>\r\n            <p>Click on the <strong>Tools</strong> menu in Opera</p>\r\n        </li>\r\n        <li>\r\n            <p>Click on the <strong>Preferences...</strong> item in the menu - a new window open</p>\r\n        </li>\r\n        <li>\r\n            <p>Click on the <strong>Privacy</strong> selection near the bottom left of the window. (See image below)</p>\r\n            <p><img src="{{skin url="images/cookies/opera.png"}}" alt="" /></p>\r\n        </li>\r\n        <li>\r\n            <p>The <strong>Enable cookies</strong> checkbox must be checked, and <strong>Accept all cookies</strong> should be selected in the &quot;<strong>Normal cookies</strong>&quot; drop-down</p>\r\n        </li>\r\n        <li>\r\n            <p>Save changes by clicking <strong>Ok</strong></p>\r\n        </li>\r\n    </ol>\r\n    <p class="a-top"><a href="#top">Back to Top</a></p>\r\n</div>\r\n', '2013-10-17 02:38:53', '2013-10-17 02:38:53', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(6, 'Privacy Policy', 'one_column', NULL, NULL, 'privacy-policy-cookie-restriction-mode', 'Privacy Policy', '<p style="color: #ff0000; font-weight: bold; font-size: 13px">\n    Please replace this text with you Privacy Policy.\n    Please add any additional cookies your website uses below (e.g., Google Analytics)\n</p>\n<p>\n    This privacy policy sets out how {{config path="general/store_information/name"}} uses and protects any information\n    that you give {{config path="general/store_information/name"}} when you use this website.\n    {{config path="general/store_information/name"}} is committed to ensuring that your privacy is protected.\n    Should we ask you to provide certain information by which you can be identified when using this website,\n    then you can be assured that it will only be used in accordance with this privacy statement.\n    {{config path="general/store_information/name"}} may change this policy from time to time by updating this page.\n    You should check this page from time to time to ensure that you are happy with any changes.\n</p>\n<h2>What we collect</h2>\n<p>We may collect the following information:</p>\n<ul>\n    <li>name</li>\n    <li>contact information including email address</li>\n    <li>demographic information such as postcode, preferences and interests</li>\n    <li>other information relevant to customer surveys and/or offers</li>\n</ul>\n<p>\n    For the exhaustive list of cookies we collect see the <a href="#list">List of cookies we collect</a> section.\n</p>\n<h2>What we do with the information we gather</h2>\n<p>\n    We require this information to understand your needs and provide you with a better service,\n    and in particular for the following reasons:\n</p>\n<ul>\n    <li>Internal record keeping.</li>\n    <li>We may use the information to improve our products and services.</li>\n    <li>\n        We may periodically send promotional emails about new products, special offers or other information which we\n        think you may find interesting using the email address which you have provided.\n    </li>\n    <li>\n        From time to time, we may also use your information to contact you for market research purposes.\n        We may contact you by email, phone, fax or mail. We may use the information to customise the website\n        according to your interests.\n    </li>\n</ul>\n<h2>Security</h2>\n<p>\n    We are committed to ensuring that your information is secure. In order to prevent unauthorised access or disclosure,\n    we have put in place suitable physical, electronic and managerial procedures to safeguard and secure\n    the information we collect online.\n</p>\n<h2>How we use cookies</h2>\n<p>\n    A cookie is a small file which asks permission to be placed on your computer''s hard drive.\n    Once you agree, the file is added and the cookie helps analyse web traffic or lets you know when you visit\n    a particular site. Cookies allow web applications to respond to you as an individual. The web application\n    can tailor its operations to your needs, likes and dislikes by gathering and remembering information about\n    your preferences.\n</p>\n<p>\n    We use traffic log cookies to identify which pages are being used. This helps us analyse data about web page traffic\n    and improve our website in order to tailor it to customer needs. We only use this information for statistical\n    analysis purposes and then the data is removed from the system.\n</p>\n<p>\n    Overall, cookies help us provide you with a better website, by enabling us to monitor which pages you find useful\n    and which you do not. A cookie in no way gives us access to your computer or any information about you,\n    other than the data you choose to share with us. You can choose to accept or decline cookies.\n    Most web browsers automatically accept cookies, but you can usually modify your browser setting\n    to decline cookies if you prefer. This may prevent you from taking full advantage of the website.\n</p>\n<h2>Links to other websites</h2>\n<p>\n    Our website may contain links to other websites of interest. However, once you have used these links\n    to leave our site, you should note that we do not have any control over that other website.\n    Therefore, we cannot be responsible for the protection and privacy of any information which you provide whilst\n    visiting such sites and such sites are not governed by this privacy statement.\n    You should exercise caution and look at the privacy statement applicable to the website in question.\n</p>\n<h2>Controlling your personal information</h2>\n<p>You may choose to restrict the collection or use of your personal information in the following ways:</p>\n<ul>\n    <li>\n        whenever you are asked to fill in a form on the website, look for the box that you can click to indicate\n        that you do not want the information to be used by anybody for direct marketing purposes\n    </li>\n    <li>\n        if you have previously agreed to us using your personal information for direct marketing purposes,\n        you may change your mind at any time by writing to or emailing us at\n        {{config path="trans_email/ident_general/email"}}\n    </li>\n</ul>\n<p>\n    We will not sell, distribute or lease your personal information to third parties unless we have your permission\n    or are required by law to do so. We may use your personal information to send you promotional information\n    about third parties which we think you may find interesting if you tell us that you wish this to happen.\n</p>\n<p>\n    You may request details of personal information which we hold about you under the Data Protection Act 1998.\n    A small fee will be payable. If you would like a copy of the information held on you please write to\n    {{config path="general/store_information/address"}}.\n</p>\n<p>\n    If you believe that any information we are holding on you is incorrect or incomplete,\n    please write to or email us as soon as possible, at the above address.\n    We will promptly correct any information found to be incorrect.\n</p>\n<h2><a name="list"></a>List of cookies we collect</h2>\n<p>The table below lists the cookies we collect and what information they store.</p>\n<table class="data-table">\n    <thead>\n        <tr>\n            <th>COOKIE name</th>\n            <th>COOKIE Description</th>\n        </tr>\n    </thead>\n    <tbody>\n        <tr>\n            <th>CART</th>\n            <td>The association with your shopping cart.</td>\n        </tr>\n        <tr>\n            <th>CATEGORY_INFO</th>\n            <td>Stores the category info on the page, that allows to display pages more quickly.</td>\n        </tr>\n        <tr>\n            <th>COMPARE</th>\n            <td>The items that you have in the Compare Products list.</td>\n        </tr>\n        <tr>\n            <th>CURRENCY</th>\n            <td>Your preferred currency</td>\n        </tr>\n        <tr>\n            <th>CUSTOMER</th>\n            <td>An encrypted version of your customer id with the store.</td>\n        </tr>\n        <tr>\n            <th>CUSTOMER_AUTH</th>\n            <td>An indicator if you are currently logged into the store.</td>\n        </tr>\n        <tr>\n            <th>CUSTOMER_INFO</th>\n            <td>An encrypted version of the customer group you belong to.</td>\n        </tr>\n        <tr>\n            <th>CUSTOMER_SEGMENT_IDS</th>\n            <td>Stores the Customer Segment ID</td>\n        </tr>\n        <tr>\n            <th>EXTERNAL_NO_CACHE</th>\n            <td>A flag, which indicates whether caching is disabled or not.</td>\n        </tr>\n        <tr>\n            <th>FRONTEND</th>\n            <td>You sesssion ID on the server.</td>\n        </tr>\n        <tr>\n            <th>GUEST-VIEW</th>\n            <td>Allows guests to edit their orders.</td>\n        </tr>\n        <tr>\n            <th>LAST_CATEGORY</th>\n            <td>The last category you visited.</td>\n        </tr>\n        <tr>\n            <th>LAST_PRODUCT</th>\n            <td>The most recent product you have viewed.</td>\n        </tr>\n        <tr>\n            <th>NEWMESSAGE</th>\n            <td>Indicates whether a new message has been received.</td>\n        </tr>\n        <tr>\n            <th>NO_CACHE</th>\n            <td>Indicates whether it is allowed to use cache.</td>\n        </tr>\n        <tr>\n            <th>PERSISTENT_SHOPPING_CART</th>\n            <td>A link to information about your cart and viewing history if you have asked the site.</td>\n        </tr>\n        <tr>\n            <th>POLL</th>\n            <td>The ID of any polls you have recently voted in.</td>\n        </tr>\n        <tr>\n            <th>POLLN</th>\n            <td>Information on what polls you have voted on.</td>\n        </tr>\n        <tr>\n            <th>RECENTLYCOMPARED</th>\n            <td>The items that you have recently compared.            </td>\n        </tr>\n        <tr>\n            <th>STF</th>\n            <td>Information on products you have emailed to friends.</td>\n        </tr>\n        <tr>\n            <th>STORE</th>\n            <td>The store view or language you have selected.</td>\n        </tr>\n        <tr>\n            <th>USER_ALLOWED_SAVE_COOKIE</th>\n            <td>Indicates whether a customer allowed to use cookies.</td>\n        </tr>\n        <tr>\n            <th>VIEWED_PRODUCT_IDS</th>\n            <td>The products that you have recently viewed.</td>\n        </tr>\n        <tr>\n            <th>WISHLIST</th>\n            <td>An encrypted list of products added to your Wishlist.</td>\n        </tr>\n        <tr>\n            <th>WISHLIST_CNT</th>\n            <td>The number of items in your Wishlist.</td>\n        </tr>\n    </tbody>\n</table>', '2013-10-17 02:38:54', '2013-10-17 02:38:54', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(7, 'Unilab', 'unilab_one_column', NULL, NULL, 'homepage', NULL, '&nbsp;', '2013-10-30 04:15:26', '2013-11-26 02:58:35', 1, 0, '<reference name="content">\r\n<block type="inquiry/quickaccess" name="inquiry.quickaccess"/>\r\n<block type="catalog/category_list" name="catalog.category.list" after="inquiry.quickaccess"/> \r\n<block type="core/template"  name="homepage-ads" after="catalog.category.list" template="page/ads/carousel.phtml">\r\n     <block type="cms/block" name="homepage-ads-content" > \r\n         <action method="setBlockId"><block_id>homepage-ads</block_id></action>\r\n    </block>\r\n   </block>\r\n</reference>\r\n<reference name="head">\r\n   <action method="addJs"><script>jquery/jcarousellite_1.0.1.min.js</script></action>\r\n</reference>', NULL, NULL, NULL, NULL, NULL),
(8, 'Terms and Condition', 'unilab_two_columns_left', NULL, NULL, 'terms-and-condition', 'Terms and Condition', '<p>Before accessing this site, please take time to read and review the terms and conditions carefully. By accessing this site, you represent and warrant to us that you have read and understood, and agree to, the terms and conditions set forth below. If you do not agree, we advise that you refrain from accessing this site.</p>\r\n<ul style="list-style: circle; padding-left: 40px;">\r\n<li>This site is not directed at children, and the services being offered are for individuals who are at least 18 years of age. Any person under 18 years old who wishes to avail of the services must provide us in advance the relevant consent from his/her parent. Should anyone whom we know to be under 18 years old access the site and manifest his/her intention to avail of the services, we will use the information so disclosed by such minor only to respond and inform him/her that we must have his/her parental consent before he/she can avail of the services being offered in this site.</li>\r\n<li>The contents of this site are provided for information purposes only. It shall in no way be construed as a substitute for a professional medical advice and should not be relied upon in that regard. For diagnosis, treatment and prescription, consult your physician and other healthcare providers. You undertake to carefully read all product packaging and labels prior to use. Consult your physician and other healthcare providers before taking any goods being offered in this site.</li>\r\n<li>For prescription medicine, we will not dispense the same without prescription from your physician.</li>\r\n<li>The contents of this are provided &ldquo;as is&rdquo;. HDSI, its affiliates, partners, agents and/or suppliers make no warranties, expressed or implied, and hereby disclaim and negate all other warranties, including without limitation, implied warranties or conditions of merchantability, fitness for a particular purpose, or non-infringement of intellectual property or other violation of rights.</li>\r\n<li>Further, they do not warrant or make any representations concerning the accuracy, likely or desired results, or reliability of the use of the goods. If at all, HDSI, its affiliates, partners, agents and/or suppliers only liability is to replace the goods found to be defective or reimburse/credit you the equal amount of the purchase price of the goods.</li>\r\n<li>In no event shall HDSI, its affiliates, partners, agents and/or suppliers be liable for any special, consequential, indirect, exemplary or incidental damages whatsoever resulting from the use of the goods or availing of the services being offered, whether such claim is based on contract, tort (including negligence), product liability or otherwise, even if advised of the possibility or likelihood of such damages.</li>\r\n<li>For returns, please see FAQ for complete details. We reserve our right to revise and amend our return policy from time to time. You undertake to review the return policy each time you avail of the services being offered in this site.</li>\r\n<li>The terms and conditions shall be governed by the laws of the Republic of the Philippines, without regard to its conflicts of laws principles. Any legal action or proceeding related to this shall be brought before the appropriate courts in Mandaluyong City, Philippines, to the exclusion of all other courts</li>\r\n</ul>', '2013-12-12 09:44:54', '2013-12-16 01:42:31', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(9, 'Privacy Policy', 'unilab_two_columns_left', NULL, NULL, 'privacy-policy', 'Privacy Policy', '<p>Your privacy is very important to us. Accordingly, we have developed this privacy policy in order for you to understand how we collect, use and disclose and make use of personal information. By agreeing to activate your account with us, you expressly agree to this privacy policy.</p>\r\n<p>The following outlines our privacy policy principles.</p>\r\n<p>Before or at the time of collecting personal information, we will identify the purposes for which information is being collected. We will collect and use of personal information solely with the objective of fulfilling those purposes specified by us and for other compatible purposes, unless we obtain the consent of the individual concerned or as required by law. We will only retain personal information as long as necessary for the fulfillment of those purposes. We will collect personal information by lawful and fair means and, where appropriate, with the knowledge or consent of the individual concerned. Personal data should be relevant to the purposes for which it is to be used, and, to the extent necessary for those purposes, should be accurate, complete, and up-to-date. We will protect personal information by reasonable security safeguards against loss or theft, as well as unauthorized access, disclosure, copying, use or modification. We will make readily available to customers information about our policies and practices relating to the management of personal information.</p>\r\n<p>We are committed to conducting our business in accordance with these principles in order to ensure that the privacy of personal information is protected and maintained.</p>\r\n<p>In this regard, we will only collect personally identifiable data, such as your name, address, telephone number, fax number, or e-mail address, and medical information (if necessary), when you voluntarily submit them to us upon activation of your account in order to avail of the services being offered in our site. We will use this information to perform the services, such as fulfilling your orders and, as may be necessary, to contact you in relation thereto. We will not sell or otherwise transfer any personally identifiable information that you have provided us to any third party unless otherwise disclosed to you beforehand and only after securing your consent, except that we may release such information to: (1) our affiliates, partners and authorized agents in order to effectively perform the services being offered; (2) any person under a duty of confidentiality to us; and (3) any person to whom we are required to make disclosure under any applicable law or by reason of a court order. We may also use the information disclosed to us for studies, statistical and other research purposes provided always that the identity of the person will be kept strictly confidential. We will also seek to take appropriate steps so that the personal information will not be retained longer than is necessary for the fulfillment of the purposes for which the information is to be used unless we have obtained your consent to use it for other purposes from those herein mentioned.</p>\r\n<p>You can access or correct any factual errors in all your personal identifiable information that we collect online by logging into your account and changing your information or by contacting us via the Contact Us menu link on the site and requesting us to assist you. To protect your privacy and security, we will take reasonable steps to verify your identity before granting access or correcting errors.</p>\r\n<p><strong><span style="text-decoration: underline;">Privacy in Linked Sites</span></strong></p>\r\n<p>Our site may contain links to a number of sites that we believe may offer useful information to you. However, the privacy policies and procedures described in the immediately preceding paragraph may not apply to those sites. We, therefore, advise that you contact those sites directly or read their own privacy policies for information on their data collection and distribution policies.</p>\r\n<p>We reserved our right to amend and revise this privacy policy from time to time to comply with existing laws, rules and regulations, orders and other issuances.</p>', '2013-12-12 09:47:13', '2013-12-12 09:47:13', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(10, 'FAQs', 'unilab_two_columns_left', NULL, NULL, 'faq', 'Frequently Asked Questions', '<p><strong>What is Health First Online Store?</strong></p>\r\n<p>The Health First Online Store is an online service that offers a wide variety of quality pharmaceutical and health &amp; wellness products at affordable prices! Health First Online Store is brought to you by Health Delivery System, Inc., a Healthcare Manager initially established to arrange and handle the health services required by its employees and their dependents.</p>\r\n<p><strong>How can I pay online?</strong></p>\r\n<p>You can pay using your MasterCard or Visa credit card! Health First Online Store&rsquo;s payment scheme is aligned with BPI-Secure Pay, a secure global payment solution, that ensures that your credit card details and Internet transactions are secure. More payment schemes will become available soon and will be announced once they are available.</p>\r\n<p><strong>Is the site safe for payment by credit cards?</strong></p>\r\n<p>Yes! Health First Online Store uses Verisign&rsquo;s Security Certificate which enables end-to-end encryption and allows you to verify the authenticity of our site.</p>\r\n<p><strong>How long will it take to get my purchases delivered?</strong></p>\r\n<p>Your purchases will be delivered to your specified address within 2-3 days from the time the order was placed. Once the goods are dispatched from the warehouse, you will receive an email confirmation that your package is on transit. In the email, a Tracking ID is provided which you can use to track your order. In the event that you don&rsquo;t receive your orders after 3 days, you may call our customer service hotline at +63 2 6375174.</p>\r\n<p><strong>I have difficulty in logging into the system? What can i do?</strong></p>\r\n<p>Make sure you have entered the correct email address and password. If you forgot your password, click on the &ldquo;Forgot Password&rdquo; icon and follow the instructions.</p>', '2013-12-12 09:51:03', '2013-12-12 09:51:03', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(11, 'Delivery Policy', 'unilab_two_columns_left', NULL, NULL, 'delivery-policy', 'Delivery Policy', '<p><strong>Health First</strong> intends to deliver your purchase within the time agreed upon your purchase. However, we cannot guarantee that all orders will be delivered on time. To help you better monitor the status of your order(s), we will send you an e-mail confirmation along with the tracking/reference number as soon as your order has been dispatched from our warehouse.</p>\r\n<p>In the event though that delay in delivery is encountered, please note that Health First shall not be liable for any losses, liabilities, costs, damages, charges, or expenses arising out of the late delivery.</p>\r\n<p>In case that you are not able to receive the delivery, we will leave a card with detailed instructions on how you can request from our dispatch unit, re-delivery of your order.</p>\r\n<p>As safeguard, please inspect the product for any defects or damage before signing to confirm the delivery and remember to keep the receipt of the delivered product. In the rare instance that your item has defect, or your order is incomplete, please get in touch with our Customer Service team at +632 6375174 or e-mail us at service@healthfirst.com.ph..</p>', '2013-12-12 09:51:58', '2013-12-12 09:51:58', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(12, 'Return Policy', 'unilab_two_columns_left', NULL, NULL, 'return-policy', 'Return Policy', '<p>In consideration that the products being purchased must follow strict storage condition, regulations, and its product&rsquo;s integrity; the following policy will be observed:</p>\r\n<p>1. Return of items will be accepted on a case to case basis.</p>\r\n<p>2. Items may be returned if bought within three (3) working days upon receipt of the items.</p>\r\n<p>3. The following items cannot be returned: a. Loose items (capsule, tablets, etc.) b. Injectables - vials, ampules, syringes c. Biologicals and other refrigerated items - vaccines, insulins, etc.</p>\r\n<p>4. Customer must e-mail a copy of Official Receipt / Delivery Receipt to service@healthfirst.com.ph</p>\r\n<p>5. Returned items must be in the original, sealed container, not damaged or adulterated.</p>\r\n<p>6. Refund of payment will be allowed after we receive the returned items but the items should be in good condition. However the amount to be refunded will be less Admin fee.</p>', '2013-12-12 09:52:50', '2013-12-12 09:52:50', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL);
